import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
class index extends Component {
  handleGo = () => {
    this.props.history.go(-2)
  }
  handlePush = () => {
    const obj = { id: '211', title: 'Ernest' }
    // params参数
    this.props.history.push(`/home/message/detail/${obj.id}/${obj.title}`)
    // // search参数
    // this.props.history.push(`/home/message/detail?id=${obj.id}&title=${obj.title}`)
    // // state参数
    // this.props.history.push('/home/message/detail', { id: obj.id, title: obj.title })
  }
  handleReplace = () => {
    this.props.history.replace()
  }
  render() {
    return (
      <ul>
        <li><button onClick={this.handleGo}></button></li>
        <li><button onClick={this.handlePush}></button></li>
        <li><button onClick={this.handleReplace}></button></li>
      </ul>

    )
  }
}
export default withRouter(index)
